import { UPDATE_TAX_YEAR } from "../actions/action-types";

const taxYearInitialState = {
    year: null,
    isVoid: null,
    isCorrected: null
}

export default function taxYearReducer(state = taxYearInitialState, action) {
    switch( action.type ) {
        case UPDATE_TAX_YEAR: 
            return action.payload 

        default:
            return state;
    }
};
